import React from 'react';
import ArtistsCard from "./ArtistsCard";
import { useState } from 'react';
import { Link } from 'react-router-dom';



import ArtistsCardStaticOne from './ArtistsCardStaticOne';


function Artists(props) {

    const [artistsData, setArtistsData] = useState({
        "Artists": [
            {
            "name": "artists name",
            "id": 1,
            "popularity": 101,
            "genreId": "genreID",
            "albums": [ "Album 1", "Album 2", "Album 3" ],
            "album_covers": [
                "url",
                "url 2",
                "https://i.scdn.co/image/ab67616d0000b273d98a6832141788d8c355852b"
            ],
            "futureEvents": [
                "Z698xZu0ZaGQo",
                "Z698xZbpZ17GA_K",
                "G5vHZb1niHezV",
                "G5vYZb11EYk12",
                "Z698xZbpZ17GA__"
            ],
            "image_url": "https://i.scdn.co/image/ab6761610000f178c3dc5429b676b16d451e5f77"
        }

        ]
    });

    return (
        <>

            <h1 class=" m-5">Artists</h1>

            <div class="row g-5 m-5" >

                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >

                <Link to={`/artists/artistspage/staticinstance1`}><h5><b>Page</b></h5></Link>
                <Link to={`/artists/artistspage/:artistsId`}><h5><b>Page</b></h5></Link>

            </div>




            {/* static dont' use */}

            {/* <div class="row g-5 m-2 " >
