                </div >
                <div class="col-xl-3 h-25" >
                    <ArtistsCardStaticThree ArtistsName={"Ella Langley"} Genre={"Country"} />
                </div >
                <div class="col-xl-3 h-25" >
                    <ArtistsCardStaticFour ArtistsName={"Central Cee"} Genre={"Hip-Hop/Rap"} />

            </div> */}

        </>

